import Header from "../commons/Header/Header";
import Footer from "../commons/Footer/Footer";
import { Card, Container } from "react-bootstrap";

function People({ data }) {
  return (
    <>
      <Header />
      <h1>People</h1>
      {data.map((people, i) => {
        return (
          <Card
            style={{
              width: "18rem",
              display: "flex",
              justifyContent: "space-around",
              flexWrap: "wrap",
              flexDirection: "row",
              width: "250px",
              height: "350",
              borderRadius: "10px",
              boxShadow: "0 4px 8px 0 rgba(0,0,0,0.2)",
              backgroundColor: "white",
              marginLeft: "30px",
              marginRight: "30px",
              marginTop: "30px",
              marginBottom: "30px",
            }}
            key={i}
          >
            <Card.Body style={{}}>
              <Card.Title>{people.name}</Card.Title>
              <Card.Text>
                Please click to reveal information about {people.name}
              </Card.Text>
              <Card.Link href="#">Card Link</Card.Link>
            </Card.Body>
          </Card>
        );
      })}

      <Footer />
    </>
  );
}

export default People;
